import axios from "axios";
import React, { useEffect } from "react";
import { useState } from "react";
import { Table } from "react-bootstrap";


const Usercrud = () => {
  const [user, getuser] = useState([]);

  

  useEffect(function () {
    axios.get("http://localhost:8000/api/user").then(
      function (rsp) {
        //console.log(rsp)
        getuser(rsp.data);
      },
      function (err) {}
    );
  }, []);

  
  return (
    <section class="col-k">
      
      <Table striped bordered hover size="lg">
        <thead>
          <tr>
            <th>Id</th>
            <th>Firstname</th>
            <th>Lastname</th>
            <th>Email</th>
            <th>Password</th>
            <th>Phone</th>
            <th>Usertype</th>
            <th>Address</th>
          </tr>
        </thead>
        <tbody>
          {user.map((dc) => (
            <tr>
              <td>{dc.id}</td>
              <td>{dc.firstname}</td>
              <td>{dc.lastname}</td>
              <td>{dc.email}</td>
              <td>{dc.password}</td>
              <td>{dc.phone}</td>
              <td>{dc.usertype}</td>
              <td>{dc.address}</td>
            </tr>
          ))}
        </tbody>
      </Table>
    </section>
  );
};

export default Usercrud;
